"use client"

import { cn } from "lazy-cn"
import { useEffect, useRef } from "react"

export function IndonesiaAnimatedStroke(
  { dashLength, className, ...props }: React.SVGProps<SVGSVGElement> & {
    dashLength: number
  }
) {

  const svgRef = useRef<SVGSVGElement>(null)
  const animationArrayRef = useRef<Animation[]>()

  useEffect(() => {


    const animations: Animation[] = []
    const paths = svgRef.current?.querySelectorAll('path')
    paths?.forEach((el, key) => {
      const length = el.getTotalLength()
      const dashL = dashLength * (length / 20) ?? 10
      if (length < 100) return
      el.style.strokeOpacity = '100'
      el.style.strokeDasharray = `${ dashL } ${ length - dashL }`
      const animation = el.animate([
        { strokeDashoffset: `${ length }` },
        { strokeDashoffset: '0' },
      ], {
        duration: length * 30,
        easing: 'linear',
        iterations: Number.POSITIVE_INFINITY,
        fill: 'backwards',
      })
      animations.push(animation)
    })

    animationArrayRef.current = animations

    return () => {
      // biome-ignore lint/complexity/noForEach: <explanation>
      animationArrayRef.current?.forEach(animation => animation.cancel())
    }
  }, [dashLength])

  return (
    <Indonesia
      style={{
        strokeLinejoin: 'bevel',
        strokeOpacity: 0,
      }}
      strokeWidth={1}
      ref={svgRef}
      className={cn(
        "",
        className,
      )}
      {...props}
    />
  )
}


